import React from "react";
import styles from "./post.module.css";

function Post({post}) {
  return (
    <div className={styles.post}>
      <img src={`/posts/${post.id}/capa.png`} alt="Imagem de capa" className={styles.capa} />
    </div>
  );
}

export default Post;
